window.bookSummaryJSON = "<p>I thought I was inheriting a life of glitz and glamour, but all I got was a castle that even a reality television show wouldn't touch.</p> <p>After inheriting Darkmoor Manor, I was ready to start my new life living in a castle. Instead, what I found inside my new home was a world full of chaos and things that make even grown men cry.</p> <p>The basement leads straight to hell, and the only ones stopping demons from raining terror on earth are four gargoyles...and me.</p> <p>I was taught to fear monsters, but with time running out to stop the demons, I'm left with no other choice but to trust the monsters that turn to stone.</p> <p><b>Will we succeed, or will the demons bring hell right to my doorstep?</b></p>"; 
